import React from 'react';
import logo from './logo.svg';
import './App.css';
// ignore the above for now, we will get to them later

import product, { numbers } from './math.js'
// we can name the import variable however we want
// it doesn't have to be product, it will still work if it is abc

console.log(numbers.reduce(product));// 50

export default App;
